window.bookSummaryJSON = "<p>As Cole plunges into war against the rebellion in the Gloaming, his enemies aren’t the only things to fear on the battlefield.</p> <p>The Shadow Realms hold more monstrous secrets than Cole or Lexi ever knew, and some of them are about to break free. When allies become enemies and betrayals unfold, Lexi and Cole will learn who they can trust and who wants them dead.</p> <p>And through it all a new threat will rise…from someone they trust.</p> <p>Return to the Shadow Realms. A world where vampires feast, lycans love deeply, dark fae seduce, witches cast their spells, dragons rule the skies...and treachery lurks around every corner.</p>"; 
